export const enum CABINET {
  USE_STATUS_AVAILABLE = 1, // 可用状态
  USE_STATUS_USING = 1, // 使用中
  USE_STATUS_BROKEN = 1, // 版本1
  VERSION_2 = 2 // 版本2
}

export const enum CABINET_BUSINESS_TYPE {
  AVAILABLE = 1,
  USING = 2,
  BROKEN = 3,
  REPAIR = 4
}

export const enum CABINET_REASONS {
  OTHERS = 3
}
